        <Navbar className='footer' fixed="bottom" collapseOnSelect expand="lg" bg="secondary" variant="dark">
            <Container fluid>
                <div>
                    <div>
                    <i class="bi bi-facebook"></i>
                    <i class="bi bi-instagram"></i>
                    <i class="bi bi-twitter"></i>
                    </div>
                    <div>
                        <ul className=''>
                            <li>Info</li>
                            <li></li>
                            <li>Support</li>
                            <li>Marketing</li>
                        </ul>
                    </div>
                    <div>
<i className="bi bi-c-circle"></i>
                    </div>



                </div>
            </Container>
        </Navbar>
    );
}

export default MyFooter;
